import { createUseStyles } from 'react-jss';
var useStyles = createUseStyles({
    Text: {
        display: 'block',
        fontSize: 14,
        lineHeight: '20px',
    },
    textParent: {
        display: 'inline',
    }
});
export { useStyles, };
